                                <div>
                                    {this.props.Lesson && this.props.Lesson.split("\n").map((line, idx) => <div key={idx}>{line}</div>)}
                                    {!this.props.Lesson && (<div>
                                        <span style={{}} key="end">{this.state.lesson_num}</span>
                                    </div>)}
                                </div>
                            </div>
                        </div>
                        <div style={{ "zIndex": 2 }} className="outerDiv centerer">
                            <div
                                id="I12:45;9:6"
